import React from "react";
// import "./Header.css";
import {
  Stack,
  Button,
  AppBar,
  Toolbar,
  IconButton,
  Typography,
  Card,
  CardActions,
  Box,
  CardContent,
  CardHeader,
} from "@mui/material";
import TaskAltIcon from "@mui/icons-material/TaskAlt";

class Header extends React.Component {
  render() {
    return (
      <>
        <AppBar position="static">
          <Toolbar>
            <IconButton size="large" edge="start" color="inherit">
              <TaskAltIcon></TaskAltIcon>
            </IconButton>
            <Typography
              variant="h6"
              component="div"
              sx={{ flexGrow: 1, textAlign: "left" }}
            >
              Task Manager
            </Typography>
          </Toolbar>
        </AppBar>

        <Card
          raised="true"
          sx={{ width: 600, height: 400, mt: 20, alignContent: "center" }}
        >
          <CardHeader
            avatar={<TaskAltIcon></TaskAltIcon>}
            title="Create New Task"
            sx={{ textAlign: "left" }}
          ></CardHeader>
          <CardContent></CardContent>
          <CardActions>
            <Button size="small">Learn More</Button>
          </CardActions>
        </Card>
      </>
    );
  }
}

export default Header;
